	add("twist", "{\"term\":\"twist\", \"etymology\":{\"influencers\":[], \"languages\":[\"middle dutch (ca. 1050-1350)\", \"English\", \"middle english (1100-1500)\"], \"text\":\"Middle english (1100-1500) probably from Middle dutch (ca. 1050-1350) \u0027twisten\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A twisting force\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Anything twisted, or the act of twisting\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1906\u0027\u0027, \u0027\u0027 Chapter\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Peter was always proud afterwards when he remembered that, with the Bargee\u0027s furious fingers tightening on his ear, the Bargee\u0027s crimson countenance close to his own, the Bargee\u0027s hot breath on his neck, he had the courage to speak the truth\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"quot;I wasn\u0027t catching fish,\u0026quot; said Peter\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"quot;That\u0027s not your fault, I\u0027ll be bound,\u0026quot; said the man, giving Peter\u0027s ear a \u0027\u0027twist\u0027\u0027\u0026amp;mdash;not a hard one\u0026amp;mdash;but still a \u0027\u0027twist\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Addiso\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Not the least turn or \u0027\u0027twist\u0027\u0027 in the fibres of any one animal which does not render them more proper for that particular animal\u0027s way of life than any other cast or texture\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"The form given in twisting\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Arbuthno\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"He] shrunk at first sight of it; he found fault with the length, the thickness, and the \u0027\u0027twist\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"The degree of stress or strain when twisted\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"A type of thread made from two filaments twisted together\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"1596\u0027\u0027, \u0027\u0027, IV.ii\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"the thrid / By griesly Lachesis was spun with paine, / That cruell Atropos eftsoones vndid, / With cursed knife cutting the \u0027\u0027twist\u0027\u0027 in twaine\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"A sliver of lemon peel added to a cocktail, etc\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, Theodore J. Albasini, \u0027The Progeny\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"Bunny sat on the only remaining stool at the leather-padded oval bar in the Iron Lounge. It was happy hour, two drinks for the price of one. She decided on a martini with a \u0027\u0027twist\u0027\u0027, and while the bartender was preparing her drink, she scanned the faces looking at the bar\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"A sudden bend (or short series of bends) in a road, path, etc\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"1899\u0027\u0027, Edith Nesbit, \u0027The Wouldbegoods\", \"priority\":20},{\"upperType\":\"NOUN\", \"text\":\"But here a \u0027\u0027twist\u0027\u0027 in the stream brought us out from the bushe\", \"priority\":21},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://openlibrary.org/works/OL5535161W Mr. Pratt\u0027s passage\u003dI stumbled along through the young pines and huckleberry bushes. Pretty soon I struck into a sort of path that, I cal\u0027lated, might lead to the road I was hunting for. It \u0027\u0027twisted\u0027\u0027 and turned, and, the first thing I knew, made a sudden bend around a bunch of bayberry scrub and opened out into a big clear space like a lawn\", \"priority\":22},{\"upperType\":\"NOUN\", \"text\":\"A distortion to the meaning of a word or passage\", \"priority\":23},{\"upperType\":\"NOUN\", \"text\":\"An unexpected turn in a story, tale, etc\", \"priority\":24},{\"upperType\":\"NOUN\", \"text\":\"A type of dance characterised by rotating one’s hips. See Wikipedia:Twist (dance\", \"priority\":25},{\"upperType\":\"NOUN\", \"text\":\"A rotation of the body when diving\", \"priority\":26},{\"upperType\":\"NOUN\", \"text\":\"A sprain, especially to the ankle\", \"priority\":27},{\"upperType\":\"NOUN\", \"text\":\"A twig\", \"priority\":28},{\"upperType\":\"NOUN\", \"text\":\"A girl, a woman\", \"priority\":29},{\"upperType\":\"NOUN\", \"text\":\"1990\u0027\u0027, 01:08:2\", \"priority\":30},{\"upperType\":\"NOUN\", \"text\":\"Dane, speaking about a woman character) \u0026quot;I\u0027ll see where the \u0027\u0027twist\u0027\u0027 flops\u0026quot\", \"priority\":31},{\"upperType\":\"NOUN\", \"text\":\"A roll of twisted dough, baked\", \"priority\":32},{\"upperType\":\"NOUN\", \"text\":\"A material for gun barrels, consisting of iron and steel twisted and welded together\", \"priority\":33},{\"upperType\":\"NOUN\", \"text\":\"The spiral course of the rifling of a gun barrel or a cannon\", \"priority\":34},{\"upperType\":\"NOUN\", \"text\":\"A beverage made of brandy and gin\", \"priority\":35},{\"upperType\":\"NOUN\", \"text\":\"A strong individual tendency or bent; inclination\", \"priority\":36},{\"upperType\":\"NOUN\", \"text\":\"a \u0027\u0027twist\u0027\u0027 toward fanaticism\", \"priority\":37}]}, \"synonyms\":{}}");

